import React from 'react'

export const Footer = () => {
  return (
    <div>
      <footer className="bg-dark text-light py-3">
        <p className="text-center">
          &copy; {new Date().getFullYear()} My Todo List. All rights reserved.
        </p>
      </footer>
    </div>
  )
}
